/** Uses the NodeAccessInfo of pOther and its children. */
void TimeAwareShaperTypeBase::useAccessInfoFromInstance(TimeAwareShaperTypeBase *pOther)
{
    OpcUa::BaseObjectType::useAccessInfoFromInstance(pOther);

    // children
    m_pInsertGateControlMethod->useAccessInfoFrom(pOther->m_pInsertGateControlMethod);
    m_pRemoveGateControlMethod->useAccessInfoFrom(pOther->m_pRemoveGateControlMethod);
    m_pSetGateControlMethod->useAccessInfoFrom(pOther->m_pSetGateControlMethod);
}

