{
    OpcUa::BaseObjectType::setAccessInfoWithChildren(pNodeAccessInfo);

    // children
    m_pInsertGateControlMethod->setAccessInfoWithChildren(pNodeAccessInfo);
    m_pRemoveGateControlMethod->setAccessInfoWithChildren(pNodeAccessInfo);
    m_pSetGateControlMethod->setAccessInfoWithChildren(pNodeAccessInfo);
}


